    false,nt"url": null,nt"notes": "This map layer shows seismic hazard in
    the United States. The data represent a model showing the probability that ground
    motion will reach a certain level. This map layer shows peak horizontal ground acceleration
    (the fastest measured change in speed, for a particle at ground level that is moving
    horizontally due to an earthquake) with a 2% probability of exceedance in 50 years.
    Values are given in %g, where g is acceleration due to gravity, or 9.8 meters/second^2.
    The lines of equal hazard, which are the lines between the polygons, were determined
    by interpolating from a grid of equally spaced points in latitude and longitude.
    Each point was weighted based on the seismic hazard at that location. The grid spacing
    is 0.1 degrees for Alaska and the conterminous United States, 0.02 degrees for Hawaii,
    and 0.05 for Puerto Rico and the U.S. Virgin Islands.",nt"owner_org": "05d603ec-9121-4f71-b09e-5d5b5a7efc64",nt"extras":
